Championnats du Monde 2020 🌈
.
L'UCI a tranché! Les Championnats du Monde se dérouleront à Imola en Italie! Après l'annulation des mondiaux à Aigle en Suisse, l'Union Cycliste Internationale s'était mise en quête en urgence de nouveaux candidats afin d'accueillir les mondiaux 2020. A seulement 1 mois à peine de leurs début l'UCI à dû trancher entre le parcours à Imola, taillé pour les Puncheurs et le parcours proposé par la France avec une arrivée à la désormais très célèbre Planche des Belles Filles avec un parcours se rapprochant de celui de Suisse, pour les grimpeurs.
Malheureusement seuls les catégories Homme et Femmes élites auront leurs courses d'organisée. Les espoirs et catégories de jeune n'auront pas la chance de participer à des championnats du monde à cause de la Covid-19.
